import React from "react";
import './Navbar.css'
import {useState} from "react";

const NavBar = () => {
    const [menu,setmMenu] = useState("shop")
    return(
        <div className="navbar">
            <p>USER</p>

            <ul className="nav-menu">
                <li onClick={()=>{setmMenu("shop")}}>SHOP {menu==="shop"?<hr/>:<></>}</li>
                <li onClick={()=>{setmMenu("apple")}}>APPLE {menu==="apple"?<hr/>:<></>}</li>
                <li onClick={()=>{setmMenu("samsung")}}>SAMSUNG {menu==="samsung"?<hr/>:<></>}</li>
                <li onClick={()=>{setmMenu("nothing")}}>NOTHING {menu==="nothing"?<hr/>:<></>}</li>

            </ul>
            <div   className="nav-login-cart">
            <button>Login</button>

            </div>
            <div>

            </div>

        </div>

    )
}
export default NavBar
